import React, { Image } from "react";
import logo from "./logo.svg";
import { ExplorerForm } from "./components/ExplorerForm";
import { ExplorerGraph } from "./components/ExplorerGraph";
import greenblack from "./resources/greenblack.svg";
import "./App.css";
function App() {
  return (
    <div
      className="App"
      style={{
        backgroundColor: "black",
        overflow: "auto",
        padding: "30px",
      }}
    >
      <header className="App-header">
        <div
          style={{
            display: "flex",
            flexDirection: "column",
          }}
        >
          <div
            style={{
              width: "100%",
              display: "flex",
              height: "5%",
              margin: "1%",
            }}
          >
            <img src={greenblack} />
          </div>
          <div
            style={{
              display: "flex",
              flexDirection: "column",
              backgroundColor: "#25282A",
              margin: "1%",

              height: "50%",
            }}
          >
            <h3
              style={{
                color: "white",
                fontFamily: "Work Sans",
                sansSerif,
                fontSize: "50px",
                padding: "20px",
              }}
            >
              EXPLORER
            </h3>
            <div
              style={{
                display: "flex",
                flexDirection: "row",
                width: "100%",
              }}
            >
              <div style={{ width: "60%" }}>
                <ExplorerGraph />
              </div>
              <div style={{ width: "40%" }}>
                <ExplorerForm />
              </div>
            </div>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
